import React from 'react';
import {BrowserRouter,Routes,Route} from 'react-router';
import Admin from '../Component/AdminPanel/Admin';

const Router=()=>{
    return(
        <div>
        <BrowserRouter>
            <Routes>
                <Route path='/' element={<Admin/>}/>
            </Routes>
        </BrowserRouter>
        </div>
    );
};

export default Router;
